column8:
ノーマルエンジンの場合エンジンヘッドに溜まる燃焼ガスなどの有害ガスは、ヘッドカバーにあるホースを使って混合気と一緒に再びシリンダーに送られています。<br>
厳密に計算された上でパワーを絞り出しているレーシングカーのチューニングエンジンは、混合気に不純物が混ざることを嫌いブローバイガスを外へ逃がしています。このブローバイガスを大気に放出することなく処理するために装着が義務づけられているのが【オイルキャッチタンク】です。<br>
ホース内径15Ф<br>
<br>
写真のステーが付属されておりますので、取付位置に合わせて調整してください。<br>
※取付位置によっては付属のステーでは対応できない場合がありますので、別途ステーをご用意いただく場合がございます。<br>
<br>
【K-PRODUCTS】<br>
<br>
